import React from 'react'

const Popup = (props) => {
  return (props.trigger)?(
    <div className='popup'>
        <div className='popup-inner'>
            <div>
                <img src="" alt="Image for whatsapp link to invite " />
                <p>whatsapp link </p>
            </div>

            <button>Close</button>
            {props.children}
        </div>
    </div>
  ):""
}

export default Popup
